uce for 20 to 30 minutes, until the sugar has completely dissolved.\r\n5. Remove the saucepan from the burner, and let stand for 10 minutes.\r\n6. Your Awesome Sauce is ready to serve, or it can be refrigerated for up to\r\nthree weeks.\r\n\r\nThai peppers and fish sauce are typically available in most Asian markets. Ghost peppers are typically considered to be the hottest pepper in the world, and may be left out for those that have a little less tolerance for heat, or if you aren\'t able to find them.\";s:6:\"format\";N;s:10:\"safe_value\";s:733:\"1. Remove the stems from the peppers.\r\n2. Add the peppers and garlic to a food processor, and blend until pureed.\r\n3. Add vinegar, sugar, fish sauce, and puree to a small saucepan, and bring to a\r\nsimmer over low heat.\r\n4. Simmer sauce for 20 to 30 minutes, until the sugar has completely dissolved.\r\n5. Remove the saucepan from the burner, and let stand for 10 minutes.\r\n6. Your Awesome Sauce is ready to serve, or it can be refrigerated for up to\r\nthree weeks.\r\n\r\nThai peppers and fish sauce are typically available in most Asian markets. Ghost peppers are typically considered to be the hottest pepper in the world, and may be left out for those that have a little less tolerance for heat, or if you aren&#039;t able to find them.\";}}}s:17:\"field_recipeyield\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:11:\"12 Servings\";s:6:\"format\";N;s:10:\"safe_value\";s:11:\"12 Servings\";}}}s:27:\"field_nutrition_information\";a:0:{}}',0,1470582044,1),('field:node:10','a:8:{s:17:\"field_description\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:1588:\"Ea letalis natu quidne. Abbas antehabeo commodo haero inhibeo metuo rusticus voco. Abico enim ibidem saepius scisco tego. Erat incassum minim pneum.\n\nComis eros hos inhibeo iriure loquor patria vel verto. Autem distineo ibidem lucidus pertineo premo qui turpis. Euismod exputo lobortis meus oppeto os pecus persto saepius. Eligo ideo minim olim paratus qui ut. Caecu